import React from 'react';
import Image from './Image';
import './UserProfile.css';

const joao = {
  id: 102,
  name: 'João',
  email: 'joao@gmail.com',
  avatar:
    'https://cdn.pixabay.com/photo/2016/08/20/05/38/avatar-1606916_640.png',
};

const amelia = {
  id: 77,
  name: 'Amélia',
  email: 'amelia@gmail.com',
  avatar:
    'https://cdn.pixabay.com/photo/2017/01/31/13/05/cameo-2023867_640.png',
};

class UserProfile extends React.Component {
  render() {
    return (
      <div>
        <p className='name'> {this.props.user.name} </p>
        <p> {this.props.user.email} </p>
        <Image source={this.props.user.avatar} alt='User avatar' />
      </div>
    );
  }
}

export default [UserProfile, joao, amelia];
